import React from 'react';
import Sdata from './Sdata';
import Image from './Image';

const Gallery=()=>{
    return(
        <>
        <div className="my-5">
        <h1 className="text-center font-weight-bold "><u>Memories</u></h1>
        </div>
        <div className="col-md-10 col-10 mx-auto">
            {Sdata.map((val,ind)=>{
                        return <Image key={ind}
                            imgsrc={val.imgsrc}
                            title={val.title}
                            text={val.text}
                        />
                    })}
  

        </div>
        </>
    ); 
};


export default Gallery;
